import classes from './Checkout.module.css'

let CheckOut = ()=>{

return(
    <div className={classes.from}>
        <form className={classes.control}>
            <label> Enter Your Full Name </label>
            <input type='text'></input>
        </form>
    </div>
)
}

export default CheckOut;
